import Task from './Task'

function Tasks() {
  const [taskList, setTaskList] = useState([
    {
      id: 1,
      title: 'Task 1',
      description: 'Description 1',
      date: '1 Jan'
    },
    {
      id: 2,
      title: 'Task 2',
      description: 'Description 2',
      date: '2 Jan'
    },
    {
      id: 3,
      title: 'Task 3',
      description: 'Description 3',
      date: '3 Jan'
    }
  ])

  return (
    <div>
      <h2>My Tasks</h2>
      {taskList.map((task) => (
        <Task task = { task }/>
      ))}
    </div>
  );
}

export default Tasks
